  return (
    <div className="App">
      <header className="App-header">Joy Division Maker : ]
      </header>
      <div className='body'>
        <Canvas></Canvas>
      </div>
      <footer className='App-footer'>
      <div className="footer-left">
        <p>2023 Ammar Jivraj&nbsp;&nbsp;&nbsp;ammarj15@gmail.com</p>
        <p></p>
    </div>
